import React, {Component} from 'react'

import {Link} from "react-scroll"

class App extends Component{


        render(){
            return(
                <div className = "navbar">


                        <Link 
                            activeClassName = "active"
                            to = "mainpage"
                            spy = {true}
                            smooth = {true}
                            offset = {-70}
                            duration={500}>
                                Main Page
                        </Link>


                        <Link 
                            activeClassName = "active"
                            to = "Education"
                            spy = {true}
                            smooth = {true}
                            offset = {-70}
                            duration={500}>
                                Education
                        </Link>




                </div>

                )
            }
        }

export default App
